import {Link, NavLink} from "react-router-dom"


const Nav = () => {
  return (
    <ul className="bg-warning">
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/instructors">Instructors</Link>
      </li>
      <li>
        <Link to="/contact">Contact</Link>
      </li>
    </ul>
  );
};

export default Nav;
